const personajes = ['goku','vegeta','trunks'];

//desestructuracion de arreglos
const[ , ,p2] = personajes;

console.log(p2);


const retornaArregle = () => {
return ['ABC', 123];

}

const [letras,numeros] = retornaArregle();
console.log(letras,numeros);
